import React, { useState, useEffect } from 'react';
import PropTypes from 'prop-types';
import { makeStyles } from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import Tabs from '@material-ui/core/Tabs';
import Tab from '@material-ui/core/Tab';
import Typography from '@material-ui/core/Typography';
import Box from '@material-ui/core/Box';
import { Link } from 'react-router-dom';
import style from './top-most-categories.css';

function TabPanel(props) {
    const { children, value, index, ...other } = props;

    return (
        <div
            role="tabpanel"
            // hidden={value !== index}
            id={`simple-tabpanel-${index}`}
            aria-labelledby={`simple-tab-${index}`}
            {...other}
        >
            {value === index && (
                <Box p={3}>
                    <Typography>{children}</Typography>
                </Box>
            )}
        </div>
    );
}

const useStyles = makeStyles(theme => ({
    root: {
        flexGrow: 1,
        backgroundColor: theme.palette.background.paper
    }
}));

function TopMostCategories({ data }) {
    const classes = useStyles();
    const [value, setValue] = useState('');
    useEffect(() => {
        setValue(data[0].name);
    }, [])
    const handleChange = (e, newValue) => {
        setValue(newValue);
    }
    return (
        <div className={`top-most-categories ${classes.root}`}>
            <AppBar position="static">
                {
                    data && data.length > 0 &&
                    <Tabs value={value} onChange={handleChange} aria-label="simple tabs example">
                        {
                            data.map(data => {
                                return (
                                    <Tab label={data.name} key={data.key} >
                                        <Link to={data.route} > </Link>
                                    </Tab>
                                )
                            })
                        }
                    </Tabs>
                }

            </AppBar>
            {
                data && data.length > 0 && data.map((data, dataIndex) => {
                    return (
                        <TabPanel value={value} index={dataIndex}>
                            {data.component}
                        </TabPanel>
                    )
                })

            }
        </div>
    );
}

TopMostCategories.propTypes = {
    data: PropTypes.array
};

export default TopMostCategories;
